import React, {Component} from 'react';
import axios from '../../axios';


class Home extends Component{

    constructor(props){
        super(props);
        this.state = {
            results : []
        }
    }
    componentDidMount(){
        axios.get('/recipe')
            .then(response => {
                console.log(response.data);
                this.setState({results : response.data});
            })
    }

    render(){
        console.log(this.state.results);
        return(
            <h1>Hello</h1>
        )
    }
}

export default Home;
